import ExpenseItem from "./ExpenseItem";
import './Expenses.css';

function Expenses(props) {
    const month = props.expenses;

    return (
        <div className="expenses">
            <ExpenseItem title={month[0].title} amount={month[0].amount} date={month[0].date}></ExpenseItem>
            <ExpenseItem title={month[1].title} amount={month[1].amount} date={month[1].date}></ExpenseItem>
            <ExpenseItem title={month[2].title} amount={month[2].amount} date={month[2].date}></ExpenseItem>
            <ExpenseItem title={month[3].title} amount={month[3].amount} date={month[3].date}></ExpenseItem>
        </div>
    );
}

export default Expenses;
